/** @format */

import React, { Component } from "react";
import getMovies from "./movie_list";

export class Movies extends Component {
  constructor() {
    super();
    this.state = {
      movie: getMovies()
    };
  }

  render() {
    return (
      <div>
        <p>Showing {this.state.movie.length} movies in the database</p>
        <table>
          <thead>
            <tr>
              <th>Title</th>
              <th>Genre</th>
              <th>Stock</th>
              <th>Rate</th>
            </tr>
          </thead>
          <tbody>
              {}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Movies;
